import React,{Component} from "react";

class MySecondClassComponent extends Component{
    state={
        balance:0,
        pin:177767,
    };
    balanceIncrement=(value)=>{
        this.setState({balance: this.setState.balance + value})
    }
    onClickHandler=()=>{
        console.log("Your OTP is 173422");
    }
    onProfitClickHandler= ()=>{
        this.balanceIncrement(1);
    }
    onDoubleProfitClickHandler= ()=>{
        this.balanceIncrement(1);
    }
    render(){

        const{name, age}=this.props;
        return(
        <>
       <h1>Hi my name is {name}, Im {age} years old, And my balance is {this.state.balance} and pin is {this.state.pin}</h1>

         <button onClick={this.onClickHandler}>Click here for OTP</button>
       </>
        );
    }

}
export default MySecondClassComponent;
